Binding.Expression:
LET $allData :=
IF( 
  [Selected Criteria Line] <> NULL, 
  DB_LOOKUPALL(
	ARRAY(
		"Assessor", 
		//"Evaluated Party UUID", 
		"Evaluated Party", 
		"Category Name", 
		"Category Percentage (Multiplied)"
	), 
	"Questionnaire", 
	"[Category Name] IS NOT EMPTY AND [Category Score] IS NOT EMPTY", 
	HASH(
		"sort", "[Evaluated Party]",
		"parent", ARRAY(EFormType, RecordID)
	)
  )
);

LET $specificData :=  
ARRAY_WHERE(
	$allData, $(i, item) 
	ARRAY_INDEX($item, 3) = [Selected Criteria] 
);

LET $panelMembers := 
ARRAY_TRANSPOSE(
  ARRAY(
	EACH [Evaluation Panel Member Username], 
	EACH [Evaluation Panel Member Name],
	EACH [Evaluation Panel Member Team]
  )
);

LET $panelMembers := 
ARRAY_WHERE(
  ARRAY_SELECT(
    $panelMembers, $(i, item) 
    LET $username := ARRAY_INDEX($item, 1);
    LET $name := ARRAY_INDEX($item, 2);
    LET $team := ARRAY_INDEX($item, 3);
    LET $teamAssignedToCriteria := ARRAY_INDEXOF([Evaluating Teams]#[Selected Criteria Line], $team) > 0; 

	RETURN IF($teamAssignedToCriteria, $item, NULL)
  ), $(i, item) 
  $item <> NULL
); 

LET $series := 
ARRAY_CONCAT(
  ARRAY_SELECT(
  $panelMembers, $(i, item) 
  HASH("label", ARRAY_INDEX($item ,2))
  ), 
  HASH("label", "Consensus", "color", "black")
);

LET $panelMemberScores := 
ARRAY_SELECT( 
  ARRAY_CONCAT($panelMembers, "Consensus"), $(m, member)
  LET $username := ARRAY_INDEX($member, 1);
  LET $name := ARRAY_INDEX($member, 2);
  LET $team := ARRAY_INDEX($member, 3);
  RETURN
  ARRAY_SELECTMANY(
	EACH [Respondent], $(i, item) 

	LET $result := 
	ARRAY_INDEX(ARRAY_TRANSPOSE(ARRAY_WHERE(
		$specificData, $(d, data) 
		AND(
			ARRAY_INDEX($data, 1) = $username, 
			ARRAY_INDEX($data, 2) = $item
		)
	)), 4);

	LET $result := IF($member = "Consensus", [Consensus Score Display]#$i, $result); 

	RETURN COALESCE($result, 0)

  )
); 

RETURN 
IF( 
  [Selected Criteria Line] <> NULL, 
  HASH(
    "series", $series, 
    "panes", 
    ARRAY(
  	  HASH(
  	    "title", "",
  	    "labels", EACH [Respondent], 
  	    "layers", 
  	    ARRAY_SELECT($panelMemberScores, $(i, item) IF($i = ARRAY_LENGTH($panelMemberScores), HASH("type", "line", "data", $item), HASH("type", "bar", "data", $item)))
  	  )
    )
  )
)

LET $data := HASH_GET([Selected Question Data], "responses");

LET $vendors := ARRAY_DISTINCT(ARRAY_SELECT($data, $(i, item) HASH_GET($item, "Evaluated Party")));
LET $panelMembers := ARRAY_DISTINCT(ARRAY_SELECT($data, $(i, item) HASH_GET($item, "Assessor Name")));

LET $columnCount := IF([Transpose Table] = TRUE, ARRAY_LENGTH($vendors), ARRAY_LENGTH($panelMembers)); 

LET $widthInCells := 60; 

LET $width := 
IF(
	[Transpose Table] = TRUE, 
	$widthInCells * 20 - 180, 

	$widthInCells * 20 - 180 - ($columnCount * 80)
); 

LET $widthPerCell := GREATEST($width / $columnCount, 250); 

LET $results := 
ARRAY_SELECT(
  $vendors, $(v, vendor)

  LET $results := 
  ARRAY_SELECTMANY(
	$panelMembers, $(m, member)

	(
	  LET $data := 
	  ARRAY_FIRST(ARRAY_WHERE($data, $(i, item) 
		  AND(
		    HASH_GET($item, "Evaluated Party") = $vendor,
		    HASH_GET($item, "Assessor Name") = $member
		  )
	  )); 

	  LET $percentScore := HASH_GET($data, "Answer Score Percentage");
	  LET $percentScore := NUMBERFORMAT($percentScore, "P");
	  LET $answer := HASH_GET($data, "Answer");
	  RETURN 
	  IF( 
		[Show Answer] = TRUE, 
		ARRAY(
		  IF($answer = "TRUE", "Yes", $answer = "FALSE", "No", $answer), 
		  $percentScore
		),

		[Show Comment] = TRUE, 
		ARRAY(
		  COALESCE(HASH_GET($data, "Comments"), "None"), 
		  $percentScore
		)
	  )
	)
  );

  LET $row := ARRAY_CONCAT($vendor, $results);
  RETURN $row
);

LET $columnsA := (
	LET $set := $panelMembers;
	RETURN
	ARRAY_CONCAT(
      ARRAY(HASH("heading", "", "width", 160)),
	  ARRAY_SELECTMANY(
		$set, $(i, item) 
		ARRAY(
		  HASH(
			"heading", $item, 
			"width", $widthPerCell
		  ),
		  HASH(
			"heading", "Score", 
			"width", 80
		  )
		)
	  )
    )
  ); 

LET $columnsB := (
  LET $set := $vendors;
  RETURN
  ARRAY_CONCAT(
    ARRAY(HASH("heading", "", "width", 160)),
  ARRAY_SELECTMANY(
	$set, $(i, item) 
	ARRAY(
	  HASH(
		"heading", $item, 
		"width", $widthPerCell
	  )
	)
  )
  )
); 

LET $table :=  
HASH(
  "columns", IF([Transpose Table] = TRUE, $columnsB, $columnsA),
  "rows", 
  IF(
	[Transpose Table] = TRUE, 
	LET $data := ARRAY_TRANSPOSE($results);

	RETURN 
	ARRAY_SELECT(
	  ARRAY_SKIP($data, 1), $(i, item) 
	  IF(
		MOD($i, 2) = 1, 
			ARRAY_CONCAT(ARRAY_INDEX($panelMembers, CEILING($i / 2)), $item),
		ARRAY_CONCAT("Score", $item)
	  )
  ), 
	$results)
);

RETURN $table

TriggerCustomEvent.EventArgumentsFormula:
LET $set := ARRAY_SELECTMANY( EACH [Evaluation Panel Member Username], $(e, evaluator)
ARRAY_SELECT( EACH [Respondent], $(r, respondent) HASH( "Evaluator", $evaluator, "Respondent", $respondent, "Respondent UUID", [Respondent UUID]#$r, "Team", [Evaluation Panel Member Team]#$e )
) );
RETURN ARRAY_INDEX($set, $count)

FieldEntry.Formula:
ARRAY_SELECT(
  EACH [Respondent Score Data], $(i, scoreData) 

  LET $data := 
  ARRAY_SELECT(
	EACH [Criteria Name], $(c, criteria) 
	LET $criteriaData := HASH_GET($scoreData, $criteria);
	LET $consensusScore := HASH_GET($criteriaData, "Consensus Score"); 
	LET $weighting := [Weighting Percent]#$c;
	LET $newWeightedScore := $consensusScore * ($weighting / 100);
	RETURN 
	HASH(

	  "Consensus Score", $consensusScore,
	  "Average Score", HASH_GET($criteriaData, "Average Score"),
	  "Weighted Score", $newWeightedScore
	)
  );

  LET $totalScore := 
  SUM(
	ARRAY_SELECT(
	  $data, $(d, item) 
	  HASH_GET($item, "Weighted Score")
    ),
	[Price Score Weighted]#$i
  );

  LET $result := 
  INDEXES_TO_KEYS(
	ARRAY_CONCAT($data, $totalScore),
	ARRAY_CONCAT(EACH [Criteria Name], "Total Score")
  );

  RETURN
  IF( 
	[Respondent]#$i <> NULL, 
	$result
  )
)

LET $data := DB_LOOKUPALL( ARRAY( "Category Name", "Category Percentage", "Assessor Name" ), "Questionnaire", "[Evaluated Party] IS NOT EMPTY AND [Category Percentage] IS NOT EMPTY AND [Evaluated Party] = " & DB_ENCODECONSTANT([Selected Respondent]) );
LET $hashData := ARRAY_TO_HASH_GROUPED( $data, $(i, item) ARRAY_INDEX($item, 1), $(i, item) HASH("Total Score", ARRAY_INDEX($item, 2), "Assessor", ARRAY_INDEX($item, 3)) );
RETURN $hashData

LET $criteria := EACH [Criteria Name];

RETURN 
ARRAY_SELECT(
  $criteria, $(i, item)
  LET $scoringData := HASH_GET([Respondent Score Data]#[Selected Respondent Line], $item);
  RETURN HASH_GET($scoringData, "Consensus Score")
)

LET $keys := EACH [Criteria Name];

RETURN 
ARRAY_SELECT(
  $keys, $(c, criteria) 
  (
	LET $criteriaData := HASH_GET([Selected Respondent Score Data], $criteria);
	LET $scores := ARRAY_SELECT($criteriaData, $(i, item) HASH_GET($item, "Total Score")); 

	RETURN AVERAGE($scores)
  )
)

LET $criteria := EACH [Criteria Name];

RETURN 
ARRAY_SELECT(
  $criteria, $(i, item)
  LET $scoringData := HASH_GET([Respondent Score Data]#[Selected Respondent Line], $item);
  RETURN HASH_GET($scoringData, "Weighted Score")
)

LET $data := DB_LOOKUPALL( ARRAY( "Evaluated Party", "Category Percentage", "Assessor Name" ), "Questionnaire", "[Evaluated Party] IS NOT EMPTY AND [Category Percentage] IS NOT EMPTY AND [Category Name] = " & DB_ENCODECONSTANT([Selected Criteria]), HASH("parent", ARRAY(EFormType, RecordID)) );
LET $hashData := ARRAY_TO_HASH_GROUPED( $data, $(i, item) ARRAY_INDEX($item, 1), $(i, item) HASH("Total Score", ARRAY_INDEX($item, 2), "Assessor", ARRAY_INDEX($item, 3)) );
RETURN $hashData

ARRAY_SELECT(
  EACH [Respondent Score Data], $(i, item) 
  LET $set := HASH_GET($item, [Selected Criteria]);
  RETURN HASH_GET($set, "Consensus Score")
)

LET $keys := EACH [Respondent];

RETURN 
ARRAY_SELECT(
  $keys, $(c, criteria) 
  (
	LET $criteriaData := HASH_GET([Selected Criteria Data], $criteria);
	LET $scores := ARRAY_SELECT($criteriaData, $(i, item) HASH_GET($item, "Total Score")); 

	RETURN AVERAGE($scores)
  )
)

ARRAY_SELECT(
  EACH [Respondent Score Data], $(i, item) 
  LET $set := HASH_GET($item, [Selected Criteria]);
  RETURN HASH_GET($set, "Weighted Score")
)
